a:260:{i:0;a:1:{s:2:"id";s:19:"2391174804415525930";}i:1;a:1:{s:10:"short_code";s:11:"CEvKNDNDTQq";}i:2;a:1:{s:12:"created_time";i:1599270271;}i:3;a:1:{s:7:"caption";s:1475:"Today is very windy.
I feel cold, but a lot of children are swimming in the sea.
I feel my age😅💦
By the way...I was surprised when I came to Australia🇦🇺
Even seniors eat fish and chips and buy rotisserie chicken and any meat at the supermarkets.
In Japan I’ve never seen my grandparents or other elderly people eating oily dishes and meat. 
Aussies have a strong stomach💪💪💪
今日はとても風が強い。
私は寒いと感じるけど子供たちは元気に海で泳いでる🥶
自分の年齢を感じるなぁ〜😅💦
ところで...オーストラリアに来てびっくりしたところ。
高齢者でもフィッシュアンドチップスを食べスーパーではロティサリーチキンを一羽、ステーキ肉を買って帰る。
私の祖父母、まわりの高齢者が油もの惣菜、肉を食べているところをあまり見たことない。
オージーたちは本当に胃が丈夫だ💪💪💪
そういえば日本人が飲む胃薬なんて飲んでるところ見たことない👀
私はすでに家に帰ってお茶漬け食べたい😂

